import React, { useState } from 'react';
import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css';


const CustomCarousel = () => {
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex, e) => {
    setIndex(selectedIndex);
  };

  return (
    <Carousel activeIndex={index} onSelect={handleSelect} interval={null} pause={null}>
      <Carousel.Item className='tree'>
        <div>
          <h3 className='treetitle'>Physo Tree</h3>
        </div>
      </Carousel.Item>
      <Carousel.Item className='tree'>
      <div>
          <h3 className='treetitle'>Intello Tree</h3>
        </div>
      </Carousel.Item>
      <Carousel.Item className='tree'> 
      <div>
          <h3 className='treetitle'>Social Tree</h3>
        </div>
      </Carousel.Item>
    </Carousel>
  );
};

export default CustomCarousel;
